import { Routes, Route } from 'react-router-dom';
import HomePage from '../home/home';
import Registration from '../registration/registration';
import Course from '../courses/course';
import RunningCourses from '../running_courses/running_courses';
import Instructors from '../instructors/instructors';
import RunningCourse from '../running_courses/running_course/running_course';
import Instructor from '../instructors/instructor/instructor';
import ErrorPage from '../../ErrorPage';


const Dashboard = () => {
    return (
        <Routes>
            <Route path="/home" element={<HomePage />} />
            <Route path="/home/registration" element={<Registration />} />
            <Route path="/course/:id" element={<Course />} />
            <Route path="/course/running/:dept_name" element={<RunningCourse />} />
            <Route path="/course/running" element={<RunningCourses />} />
            <Route path="/instructor" element={<Instructors />} />
            <Route path="/instructor/:id" element={<Instructor />} />
            {/* <Route exact path="*" element={<ErrorPage />} /> */}
        </Routes>
        )
}

export default Dashboard;
